script: |
  super -f text -I q9445.spq | sort > q9445.out

inputs:
  - name: q9445.spq
    data: |
      SELECT DISTINCT - - col2 / - col0 + + cor0.col1 + + ( 45 * + cor0.col2 ) FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q9445.out
    data: |
      142
      1570
      3781
